      string: "<!doctype html public \"-//W3C//DTD HTML 4.0 Transitional//EN\">\r\n\r\n\r\n<head>\r\n<title>Bob
        Freeman - Surfer</title>\r\n\r\n</head>\r\n\r\n<body Text=\"#000000\" width=750
        LINK=\"#0000ff\" VLINK=\"#0ccfff\" ALINK=\"#888888\" #SaveReturnPath topmargin=\"10\"
        leftmargin=\"10\" RESIZE>\r\n\r\n<table background=\"http://www.bobfreemansurf.com/piercam/bg5.jpg\"
        width=750 border=4 cellpadding=20>\r\n <tr>\r\n  <td width=670>\r\n<P align=right><font
        color=black face=Arial size=2><a href=\"http://www.bobfreemansurf.com\"><img
        src=\"http://www.bobfreemansurf.com/piercam/home1.jpg\"></a> <a href=\"mailto:bob@bobfreemansurf.com\"><img
        src=\"http://www.bobfreemansurf.com/piercam/email1.jpg\"></a>\r\n</P>\r\n<table
        width=450>\r\n  <tr>\r\n    <td width=100>\r\n    </td>\r\n    <td width=150
        ><img src=\"http://www.bobfreemansurf.com/piercam/bob-70s.jpg\" width=150
        border=1>\r\n    </td>\r\n    <td width=200><font size=4 color=black><b><i>Bob
        Freeman<br><br><br><font size=5>Surf Reporting<br>and Forecasting</i></b></font>\r\n
        \   </td>\r\n  </tr>\r\n</table>\r\n<br><br>\r\n<P align=left>\r\n\r\n<font
        size=5 color=black>\r\n... time to retire</font><font size=3 color=black><br>\r\n\r\n<br><br>\r\nMy
        first surf reports and weekend forecasts were broadcast live from Canaveral
        Pier over WKKO radio back in 1970.\r\n<br>\r\nLink to story... <a href=\"http://www.bobfreemansurf.com/surfrpt.htm\">My
        1st Surf Reports</a>\r\n<br><br>\r\nI launched my DAWN PATROL EYE BALL VISUAL
        AND DETAILED ANALYSIS website in 1999.\r\n<br><br>\r\nIn 2002 Florida Today
        began publishing my weekend surf forecasts every Friday.\r\nAnd for a short
        time I reported on a local cable show.\r\nMy reports were eventually picked
        up by a dozen other publications.\r\n<br>\r\n<br>\r\n \r\n<font size=5 color=black>\r\nBut
        now...<br>\r\n<b><i>\r\nI just don't wanna do it anymore.<br>\r\nI just wanna
        surf\r\n</b></i>\r\n</font>\r\n\r\n<br><br>\r\nI tried my best to learn how
        to read weather maps and satellite imagery to forecast when and where waves
        would form.\r\n<br>\r\nI watched swell and wind strengths and their respective
        directions, \r\n<br><br>\r\nToday there are plenty of on-line tools providing
        all levels of surf forecasting.\r\n<br>\r\nI had several favorites, but I
        paid close attention to our two near-shore NOAA buoys to help determine current
        wave variances all along Brevard County beaches.<br>\r\n\r\n<b>Buoy 41113
        ...</b> <a href=\"http://www.ndbc.noaa.gov/station_page.php?station=41113\">2
        mile buoy</a>\r\n<br>\r\n<b>Buoy 41114 ...</b> <a href=\"http://www.ndbc.noaa.gov/station_page.php?station=41114\">Ft
        Pierce buoy</a>\r\n <br>\r\n<br><br>\r\nI hope my reporting and my best effort
        attempts at forecasting have been helpful.<br>\r\nI enjoyed doing it all these
        years.<br>\r\n<br>\r\n\r\nI'm now watching indicators to plan my next surf
        session\r\n<br>\r\n<br>\r\nBest wishes<br>\r\nSurf on\r\n\r\n<table>\r\n  <tr>\r\n
        \ <td width=800>\r\n<br>Contact Bob... <a href=\"mailto:bob@bobfreemansurf.com\">Send
        Email</a>\r\n<br>\r\n<br>\r\n<font size=3face=Arial>Some memories here...
        <a href=\"http://www.bobfreemansurf.com\">BobFreemanSurf.com</a>\r\n  </td>\r\n
        </tr>\r\n\r\n</table>\r\n \r\n\r\n</td>\r\n</tr>\r\n</table>\r\n<!-- ----
